import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";

import notes from "../notes" 

function App() {
  return (
    <div>
      <Header />
      <Note 
      key={notes[1].id}
      title={notes[1].title} 
      content={notes[1].content}
      />
      <Footer />
    </div>
  );
}

export default App;
